import React from "react";

let csrfToken = $('meta[name="csrf-token"]').attr('content');


export default function search() {
    return (
        <div className="search">
            <form name="searchBox" target="http://www.google.com" method="POST">
                <input type="text" placeholder="Search for a movie" className="searchbar" id="searchbar" />
                <input type="submit" hidden value={csrfToken} />
            </form>
        </div>
    );
}
